import React from "react";
import bgimg from "../../image/bgimg2.jpg";
const Landing = () => {
  return (
    <section className="landing">
      <div className="dark-overlay">
        <div className="landing-inner">
          <img
            src={bgimg}
            width="100%"
            height="70%"
            className="d-inline-block align-top"
            alt="ipicXel logo"
          />
        </div>
      </div>
    </section>
  );
};

export default Landing;
